import React from 'react';

const List = ({people}) => {
  return (
    <>
      {people.map((person)=>{
          const {id,age,name,image}=person;
          return <article className='person'>
            <img src={image} alt={name}></img>
            <div>
              <h4>name</h4>
            </div>
          </article>
      })}
    </>
  );
};

export default List;
